import React, { Component } from 'react';
import GetHomeService from '../../services/GetHomeService.js';

class Homes extends Component {

    constructor(props) {

        super(props);
        let homes = GetHomeService.getHomes('http://localhost:8080/homes');
        this.state = {
            todos:
                [
                    { id: 1, description: 'Learn to Dance', done: false, targetDate: new Date() },
                    { id: 2, description: 'Become an Expert at React', done: false, targetDate: new Date() },
                    { id: 3, description: 'Visit India', done: false, targetDate: new Date() }
                ],
            homelist: { homes }
        }


    }


    render() {
        console.log(this.state.homelist)
        return (
            <>
                <div className="container bg-light">
                    <h2>My Todo list </h2>
                    <table className='table table-striped'>
                        <thead className='thead-dark'>
                            <tr>
                                <th>Description</th>
                                <th>Completed</th>
                                <th>Due Date</th></tr>
                        </thead>
                        <tbody>
                            {
                                this.state.todos.map(
                                    todo =>
                                        <tr key={todo.id}>
                                            <td>{todo.description}</td>
                                            <td>{todo.done.toString()}</td>
                                            <td>{todo.targetDate.toString()}</td>
                                        </tr>
                                )
                            }
                        </tbody>

                    </table>

                    <table className='table table-striped'>
                        <thead className='thead-dark'>
                            <tr>
                                <th>Description</th>
                                <th>Completed</th>
                                <th>Due Date</th></tr>
                        </thead>
                        <tbody>
                             {
                                this.state.homelist.map(
                                    home =>
                                        <tr key={home.homeId}>
                                            <td>{home.name}</td>
                                            <td>{home.url.toString()}</td>
                                            <td>{home.phone.toString()}</td>
                                        </tr>
                                )
                            } 

                        </tbody>

                    </table>
                </div>
            </>);


    }


}






export default Homes;
